import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Import React Router components
import LoginForm from './pages/pasindu/LoginForm'; // Import your LoginForm component

const App = () => {
  return (
    <Router>
      <div className="App">
        <Switch>
          {/* Define routes for your pages */}
          <Route path="/login" component={LoginForm} />  {/* Login page route */}
          {/* You can add more routes here for other pages */}
          <Route path="/" exact>
            <h1>Home Page</h1>
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
